PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE slider_configs (
	id INTEGER NOT NULL, 
	name VARCHAR(100) NOT NULL, 
	description TEXT, 
	thresholds JSON NOT NULL, 
	timestamp DATETIME, 
	PRIMARY KEY (id), 
	UNIQUE (name)
);
CREATE TABLE slider_recordings (
	id INTEGER NOT NULL, 
	session_id VARCHAR(100), 
	slider_key VARCHAR(50) NOT NULL, 
	value FLOAT NOT NULL, 
	min_value FLOAT NOT NULL, 
	max_value FLOAT NOT NULL, 
	timestamp DATETIME, 
	PRIMARY KEY (id)
);
COMMIT;
